import React from 'react';
import Movies from './movies/Movies';
import Showcase from './showcase/Showcase';
const MoviesRoute = props => {
  return (
    <>
      <Showcase />
      {props.map(movies => (
        <Movies {...movies} key={movies.id} />
      ))}
    </>
  );
};

export default MoviesRoute;
